import React from 'react'
import {BrowserRouter,Routes,Route} from "react-router-dom";
import Navbar from './components/navbar/Navbar';
import Accueil from './pages/accueil/Accueil';
import Connexion from './pages/connexion/Connexion';
import Inscritpion from './pages/inscription/Inscritpion';
import contextAuth from './context/contextAuth';
import { useState } from 'react';
import Annonces from './pages/annonces/Annonces';

export default function App() {

  const valeurInitialToken = localStorage.getItem("token")? 
  localStorage.getItem("token") : "";

  const [token, settoken] = useState(valeurInitialToken);

  return (
    <div>
        <BrowserRouter>
            <contextAuth.Provider value={{token,settoken}}>
              <Navbar/>
              <Routes>
                  <Route path="/" element={<Accueil/>}/>
                  <Route path="/connexion" element={<Connexion/>}/>
                  <Route path="/inscription" element={<Inscritpion/>}/>
                  <Route path="/Annonces" element={<Annonces/>}/>
              </Routes>
            </contextAuth.Provider>
        </BrowserRouter>
    </div>
  )
}
